import { withInstall } from "../utils/index.mjs";
import _Circle from "./Circle.mjs";
const Circle = withInstall(_Circle);
var stdin_default = Circle;
import { circleProps } from "./Circle.mjs";
export {
  Circle,
  circleProps,
  stdin_default as default
};
